import React from 'react';
import styled from 'styled-components';
import Footer from '../Footer';
import Info from '../Info';
import Navbar from '../Navbar';

const Container = styled.div`
`;
const Wrapper = styled.div`
    padding: 20px
`;
const Title = styled.h1 `
    font-weight: 300;
    text-align: center;
`;
const Top = styled.div `
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 20px;
`;
const TopBtn = styled.button `
    padding: 10px;
    font-weight: 600;
    cursor: pointer;
    border: ${props=>props.type === 'filled' && 'none'};
    background-color: ${(props)=>
        props.type === 'filled' ? 'black' : 'transparent'};
    color: ${(props)=>props.type === 'filled' && 'white'};
`;
const TopTxtWrap = styled.div`
`;
const TopTxt = styled.span `
    text-decoration: underline;
    cursor: pointer;
    margin: 0px 10px;
`;
const Bottom = styled.div `
    display: flex;
    justify-content: space-between;
`;
const Inform = styled.div `
    flex: 3;
`;
const Summary = styled.div `
    flex: 1;
`;
const Product = styled.div `
`;
const Image = styled.img `
`;
const Details = styled.div `
`;
const ProductName = styled.div `
`;
const ProductDetail = styled.div `
`;

const Cart = () => {
  return (
    <Container>
        <Navbar/>
        <Info/>
        <Wrapper>
            <Title>YOUR BAG</Title>
            <Top>
                <TopBtn>ADD SOMETHING ELSE</TopBtn>
                <TopTxtWrap>
                    <TopTxt>Shopping Bag(3)</TopTxt>
                    <TopTxt>Your Favorite</TopTxt>
                </TopTxtWrap>
                <TopBtn type='filled'>PROCEED TO CHECKOUT</TopBtn>
            </Top>
            <Bottom>
                <Inform>
                    <Product>
                        <ProductDetail>
                            <Image/>
                            <Details>
                                <ProductName><b>Product: </b>Standard Short Sleeves Shirt - Blue Buds on Gray</ProductName>
                            </Details>
                        </ProductDetail>
                    </Product>
                </Inform>
                <Summary>Summary</Summary>
            </Bottom>
        </Wrapper>
        <Footer/>
    </Container>
  )
}

export default Cart
